// src/SelectTimePage.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const SelectTimePage = () => {
  const [preferredTime, setPreferredTime] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    // Assume API call or logic to save preferredTime here
    alert(`Preferred notification time: ${preferredTime}`);
    navigate('/welcomep'); // Redirect to WelcomePage
  };

  return (
    <div className="App">
      <div className="header">
        <h2>Select Your Preferred Notification Time</h2>
      </div>
      <div className="main-content">
        <form onSubmit={handleSubmit}>
          <label>
            Enter your preferred time:
            <input
              type="time"
              value={preferredTime}
              onChange={(e) => setPreferredTime(e.target.value)}
              required
            />
          </label>
          <button type="submit">SCHEDULE A NOTIFICATION</button>
        </form>
      </div>
      <div className="footer">
  
      </div>      
    </div>
  );
};

export default SelectTimePage;
